import React from 'react';
import { Container, Box, Typography, Link } from '@mui/material';

const LandingPage = () => {
  return (
    <div>
      <Container maxWidth="lg">
        {/* Full-height section with text */}
        <Box
          style={{
            minHeight: '100vh',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'flex-start',
          }}
        >
          {/* Updated text alignment and content */}
          <Box style={{ marginLeft: '5%' }}>
            <Typography variant="body1" color="textSecondary">
              Jack Retterer - 
            </Typography>
            <Typography variant="h1" style={{ fontWeight: 'bold' }}>
              currently building,
            </Typography>
            <Typography variant="h1" style={{ fontWeight: 'bold' }}>
              hopefully cool things.
            </Typography>
          </Box>
        </Box>

        {/* Navigation Links */}
        <Box textAlign="center" my={4}>
          <Typography variant="h6">Interested in my work?</Typography>
          {/* Link to the Projects section */}
          <MuiLink href="#projects" color="primary">
            View My Projects
          </MuiLink>
          {/* Add more links to other sections like About and Experience */}
        </Box>

        {/* About Section */}
        <Box id="about" style={{ minHeight: '100vh' }}>
          {/* About content goes here */}
        </Box>

        {/* Experience Section */}
        <Box id="experience" style={{ minHeight: '100vh' }}>
          {/* Experience content goes here */}
        </Box>

        {/* Projects Section */}
        <Box id="projects" style={{ minHeight: '100vh' }}>
          {/* Projects content goes here */}
        </Box>
      </Container>
    </div>
  );
};

export default LandingPage;
